var express = require('express');
var app = express();

const regularJigglypuff = "data:image/png;base64,"
const shinyJigglypuff = "data:image/png;base64,"

function isJigglypuffShiny() {
  return process.env.JIGGLYPUFF === 'shiny';
}

function getJigglypuffImage() {
  return isJigglypuffShiny() ? shinyJigglypuff : regularJigglypuff;
}

function getJigglypuffVariantName() {
  return isJigglypuffShiny() ? "shiny" : "regular";
}

// Routes
app.get('/', function(req, res) {
  res.send(`<html><body>Here is a ${getJigglypuffVariantName()} Jigglypuff:<br><img width="200" height="200" src="${getJigglypuffImage()}"/></body></html>`);
});

// Listen
var port = process.env.PORT || 3000;
console.log("Starting Jigglypuff server");
app.listen(port, () => console.log('Listening on port '+ port));
